func Test_hysteriaConf(t *testing.T) {
	s := `hysteria://host:123?protocol=udp&auth=123456&peer=sni.domain&insecure=1&upmbps=100&downmbps=100&alpn=hysteria&obfs=xplus&obfsParam=123456#remarkse`
	conf, err := hysteriaConf(s)
	if err != nil {
		t.Fatal(err)
	}
	fmt.Printf("%+v\n", conf)
}

func Test_ParseProxy(t *testing.T) {
	type args struct {
		info string
	}
	tests := []struct {
		name          string
		args          args
		wantProxies   []*proxyInfo
		wantCloudName string
	}{
		{
			name: "test1", args: args{
				info: ``,
			},
			wantProxies:   nil,
			wantCloudName: "",
		},
		{
			name: "test1", args: args{
				info: "",
			},
			wantProxies:   nil,
			wantCloudName: "",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			decodeString, err := base64Decode(tt.args.info)
			if err != nil {
				t.Errorf("parseInfo() error = %v", err)
				return
			}
			gotProxies := ParseProxy(string(decodeString))
			marshal, err := json.Marshal(gotProxies)
			if err != nil {
				t.Errorf("parseInfo() error = %v", err)
				return
			}
			t.Log(string(marshal))
			if !reflect.DeepEqual(gotProxies, tt.wantProxies) {
				t.Errorf("parseInfo() gotProxies = %v, want %v", gotProxies, tt.wantProxies)
			}
		})
	}
}

